import React from "react";

const MobileViewInfo = () => {
  return (
    <div>
      <h1>Sorry, This URL is not allowed to be accessed via mobile device.</h1>
      <h1>Please retry with desktop device</h1>
    </div>
  );
};

export default MobileViewInfo;
